INSERT INTO `cvc_action_log` VALUES (312, 206, NULL, 4, 'Se llamo a cliente (Wilber Carbajal) se indico sobre la rechaza manual de carga programada, desconoce del tema, se recomendó que consulte con su técnico o ingeniero encargado, menciono que mejor apagara todo.', '2024-11-26 15:42:57', 257);
INSERT INTO `cvc_action_log` VALUES (313, NULL, 432, NULL, 'Finalmente se llama a la Srta. Tatiana, quien no contestó las llamadas realizadas.', '2024-11-26 16:09:02', 257);
INSERT INTO `cvc_action_log` VALUES (314, 317, NULL, 3, 'Se llamó a Sr. HAROLD SALAZAR, para consultar sobre corte programado  con fecha 24/11 desde 7:00 - 15:30,  no se tuvo éxito.', '2024-11-27 09:31:08', 257);
INSERT INTO `cvc_action_log` VALUES (315, NULL, 450, NULL, 'Se indicó a la encargada Srta. SILVIA HUAMAN que la energía llegó a las 2pm, se solicita verificar de manera interna (de repente bajaron la palanca). Menciona que hará las validaciones caso contrario llamará a CVC para gestionar la interrupción.', '2024-11-27 14:00:36', 257);
INSERT INTO `cvc_action_log` VALUES (316, 324, NULL, 3, 'Se comunicó el Sr. LUIS SANDOVAL VALDIVIESO de la empresa PROCESADORA COMERCIALIZADORA MONTENEGRO | PROCOMSAC e indica que a fueras del predio de la planta indusatrial esta unos cables de fluido eléctrico que está colgado entre postes y dificulta la entrada y salida de los camiones debido que es un riesgo eléctrico.', '2024-11-27 14:13:20', 375);
INSERT INTO `cvc_action_log` VALUES (317, NULL, 462, NULL, 'Se llamó a la distribuidora Pluz Energía, para reportar la emergencia porque a fueras del predio esta colgado un cable entre postes, el cual es un riesgo de fluido eléctrico para la salida y entrada del camión. Menciona que la emergencia derivó al personal técnico. Número de atención 700140066, estarían solucionado en transcurso del día como máximo hasta 9:15pm.', '2024-11-27 14:33:18', 375);
INSERT INTO `cvc_action_log` VALUES (318, NULL, 462, NULL, 'Se llamó a la distribuidora Pluz Energía, para reportar la emergencia porque a fueras del predio esta colgado un cable entre postes, el cual es un riesgo de fluido eléctrico para la salida y entrada del camión. Menciona que la emergencia derivó al personal técnico. Número de atención 700140066, solucionaran el día de hoy en transcurso de horas, en caso la emergencia sea compleja se derivará a otro cuadrilla. Plazo máximo de atención 9:15pm.', '2024-11-27 14:37:12', 378);
