INSERT INTO `cvc_seguimientos` VALUES (127, 373, 35, 142, NULL, NULL, '12:10  Se comunicó el Sr. Anthony Davila, comenta que el día de ayer se fue el fluido eléctrico aproximadamente a las 10:30 am y regresó como a las 4:00 pm. Sin embargo el día de hoy a las 11:40 am se volvió a ir por lo que se siente incomodo y solicita el motivo; además de una solución para poder prender sus máquinas.', '2024-11-01 12:44:41', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (128, 376, 35, 145, NULL, NULL, 'Se comunicó el Sr. Anthony Davila, consulta nuevamente acerca de su servicio. \nSe le indica que ya nos comunicamos Centro de Control sin embargo  no nos ha brindado un horario exacto de restablecimiento del fluido eléctrico.', '2024-11-01 14:02:59', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (129, 376, 35, 146, NULL, NULL, '13: 30 pm Se llamo al Centro de Control, atendio la supervisora Maribel la cual indica que están trabajando para solucionar el inconveniente pero todavía no hay un horario exacto de cuanto demoren los trabajos. Se recordó que ya viene  a ser un problema reiterativo y que el cliente se encuentra incomodo.', '2024-11-01 14:05:46', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (130, 376, 35, 147, NULL, NULL, 'Se llamo Sr. Anthony Davila  el cual confirmo que ya se restableció la energía confirmando lo que menciono el Centro de Control  minutos antes. Cliente indica que le envíen un informe de lo sucedido a los siguientes correos: \nadavila@grupovalor.com\nrmatute@grupovalor.com', '2024-11-01 14:31:46', NULL, NULL);
