INSERT INTO `cvc_seguimientos` VALUES (177, 374, 81, 309, NULL, NULL, 'SE LLAMO AL SR. LENIN CESPEDES Y TAMPOCO SE TUVO ÉXITO, SE PROCEDE A REENVIAR EL CORREO RECALCANDO QUE SU SOLICITUD AUN NO HA SIDO ATENDIDA.  ', '2024-11-06 05:22:12', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (178, 374, 72, 295, NULL, NULL, 'Nos comunicamos con la distribuidora, indica que  no hay orden  registrada,  de igual manera se registrada como emergencia  25170806994 cco plazo de  4 horas', '2024-11-05 23:28:09', '2024-11-30 15:30:52', 375);
INSERT INTO `cvc_seguimientos` VALUES (179, 375, 81, 320, NULL, NULL, 'Nos comunicamos con el cliente para explicar que se  verifico  su suministro del cliente y verifico que se encuentra conforme marcando una tensión de 226V, así mismo reviso la linea de MT para su alimentación de su suministro y se encuentro conforme,', '2024-11-06 11:53:24', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (180, 378, 87, 321, NULL, NULL, 'Se llamó al Ing. Galo Ventura de la empresa OVC Contratistas SAC para informar respecto a la presentación de algún folleto, broucher para ser proveedor, debe realizarlo mediante un correo de logística (se brindo el correo indicado por José).', '2024-11-06 12:57:50', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (181, 375, 70, 324, NULL, NULL, 'Nos comunicamos con la distribuidora nos confirma que hasta el momento no tiene el informe técnico por parte de su área, nos indica que esta volviendo  a ingresar nuestro caso con el mismo numero de atención', '2024-11-06 15:31:04', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (182, 375, 72, 325, NULL, NULL, 'Se llamó a la distribuidora para consultar sobre el caso y nos indican que se acercará una cuadrilla en un  plazo de 4 horas con código  de atención  2517080756 por ser vía pública se estará dando prioridad.', '2024-11-06 17:32:42', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (183, 375, 70, 326, NULL, NULL, 'Nos comunicamos con el cliente, indica que se reestablecio con normalidad su servicio de energia electrica.', '2024-11-06 15:47:14', '2024-11-15 09:08:20', 257);
INSERT INTO `cvc_seguimientos` VALUES (184, 375, 72, 327, NULL, NULL, 'Nos comunicamos con la distribuidora ( sofia escobar).  genera un codigo de atencion 25170807092', '2024-11-06 08:02:00', '2024-11-15 09:38:01', 257);
INSERT INTO `cvc_seguimientos` VALUES (185, 374, 70, 328, NULL, NULL, 'Se llamó a cliente  para informar, pero no contesta.', '2024-11-06 01:10:07', '2024-11-30 16:37:12', 375);
INSERT INTO `cvc_seguimientos` VALUES (187, 372, 72, 334, NULL, NULL, 'Se llamó a la distribuidora EMSA e indica que no hubo cuadrillas disponibles por averías en otra zonas, el reporte ya está fuera de plazo. Se generó un nuevo código de atención 25170807942 para que se acerquen a verificar porque salen las chispas del poste y no brinda plazo de horas.', '2024-11-06 18:22:56', '2024-11-14 08:16:22', 257);
INSERT INTO `cvc_seguimientos` VALUES (189, 375, 72, 339, NULL, NULL, 'Se llamó a la distribuidora EMSA Se generó un nuevo código de atención 25170807942 para que se acerquen a verificar porque salen las chispas del poste y no brinda plazo de horas.', '2024-11-06 18:16:56', '2024-11-14 08:31:06', 257);
INSERT INTO `cvc_seguimientos` VALUES (190, 372, 72, 340, NULL, NULL, 'Se comunicó el Sr. Segundo Navarro de la empresa RED DE DISTRIBUCION GALVEZ con respecto a las chispas que sale del poste cerca a su domicilio. Se explicó que no hubo cuadrillas disponibles por averías en otra zonas, el reporte ya está fuera de plazo. Se generó un nuevo código de atención 25170807942 para que se acerquen a verificar y se está haciendo seguimiento al caso.', '2024-11-06 19:35:51', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (191, 374, 72, 342, NULL, NULL, 'Se comunicó el encargado de la empresa RED DE DISTRIBUCION GALVEZ, consultando acerca del estatus con referente a las chispas que salen del poste, se le informa que ya nos hemos comunicado con la distribuidora, sin embargo, no hay un plazo estimado de atención. Por otro lado, se le comenta que se está realizando el seguimiento correspondiente y nos comunicaremos con él, cuando tengamos novedades.', '2024-11-06 22:17:29', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (192, 374, 72, 343, NULL, NULL, 'Se llamó a la distribuidora, para saber el estado, del inconveniente reportado. Sien embargo, asesora indica que no hay un plazo de atención y que se realizó nuevamente la notificación al área correspondiente.', '2024-11-07 00:54:55', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (193, 374, 72, 345, NULL, NULL, 'Se llamó al cliente en el transcurso de la noche y no contestó, se llamó ahora en la mañana e indica que problema del poste persiste y no se han acercado hasta el momento.', '2024-11-07 06:34:10', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (194, 374, 72, 346, NULL, NULL, 'Se llamó a la distribuidora nuevamente y menciona que el caso será reportado nuevamente con prioridad, brinda número de atención 25170808152, no hay plazo de solución.', '2024-11-07 06:44:59', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (195, 375, 72, 348, NULL, NULL, 'Se llamó a la distribuidora nuevamente  para darle seguimiento al caso,  nos menciona conseguir un numero de  suministro de algún vecino para reportar  el incidente de igual manera se envió mensaje por medio de WhatsApp', '2024-11-07 09:37:01', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (196, 378, 72, 359, NULL, NULL, 'Se llamó al Sr. Segundo Navarro de la empresa RED DE DISTRIBUCION GALVEZ, notificando que el Jefe de Grandes Clientes de ENSA que está a cargo de toda la zona nos menciona que en cuanto a la estructura que está botando el chispazo (según fotos y videos que enviaron) corresponde a una estructura de que es el PMI. Si la falla es en el PMI como se visualiza en el video ENSA va comunicar a REDIGAL o al call de CVC solicitando ¨Carta formal para que haga su mantenimiento correctivo¨. Por ello es importante que vaya viendo el tema del mantenimiento correctivo (en cuanto los técnicos y evaluando la falla) porque cuando llegue la comunicación de ENSA vamos a trasladarlo a su empresa. Tener presente que ENSA pueda solicitar a REDIGAL el corte (para realizar los trabajos) o ENSA corte por riesgo electrónico. Finalmente va depender mucho que acciones va tomar.', '2024-11-07 18:47:12', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (197, 375, 94, 368, NULL, NULL, 'Nos comunicamos con la distribuidora  para consultar sobre el incidente por parte del cliente:  nos menciona que no hay corte programado  y se va a proceder con el registro de  atención  por variación de tensión   con  código    25170809301  plazo de 24 horas.', '2024-11-08 08:28:20', '2024-11-08 09:09:28', 185);
INSERT INTO `cvc_seguimientos` VALUES (198, 375, 94, 369, NULL, NULL, 'Nos comunicamos con el cliente Sr, Segundo Navarro  para informarle lo que nos menciono la distribuidora  plazo de atención 4 horas darle seguimiento.', '2024-11-08 07:59:08', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (201, 378, 94, 372, NULL, NULL, 'Se llamó al Sr. Segundo Navarro de la empresa RED DE DISTRIBUCION GALVEZ,  para informar que su distribuidora indica que no hay corte programado y el inconveniente que se está presentando en su compañía es por variación de tensión debido a las chispas que está presentando en los postes. Por ello, la empresa (REDIGAL) debe realizar mantenimiento correctivo. Las ejecutivas lo estarán notificando mediante un correo electrónico de forma formal  en transcurso de la tarde referente al MANTENIMIENTO CORRECTIVO.', '2024-11-08 13:06:18', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (202, 372, 98, 385, NULL, NULL, 'Se llamó a la distribuidora Hidrandina y explicó el motivo que toda en esta semana a las 7pm  tiene problemas con la red como baja de tensión y fluidez de tensión dicha caída de tensión durando 3 minutos y tiene problemas con los equipos de proceso. Brinda código de atención 50171660176 y plazo de atención de 1 a 4 horas para que vaya el personal de emergencia.', '2024-11-09 20:08:09', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (203, 372, 98, 387, NULL, NULL, 'Se llamó al  Sr. Edgar Rodríguez de la empresa AVOCADO PACKING COMPANY SAC indicando que su distribuidora Hidrandina brindó el código de atención   50171660176 y se estará acercando el personal de emergencia en un plazo de 4 horas.', '2024-11-09 20:16:12', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (204, 374, 98, 388, NULL, NULL, 'Se llamó al Sr. Edgar Rodríguez de la empresa AVOCADO PACKING COMPANY SAC, para consultar si su distribuidora se acercó al punto para revisar el inconveniente reportado e indica que no se acercado nadie. Asimismo, menciona que el inconveniente solo pasa a las 7:00 pm todos los días.', '2024-11-10 00:33:19', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (205, 374, 98, 389, NULL, NULL, 'Se llamó a la distribuidora y menciona que la cuadrilla ya fue a dar solución y realizaron las revisiones correspondientes. Asimismo menciona que dejaron el servicio operativo y el día de hoy, ya no tendría por que suceder lo mismo.', '2024-11-10 00:42:49', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (206, 374, 98, 390, NULL, NULL, 'Se llamó a cliente, para informar lo mencionado por la distribuidora. Se le menciona que el día de hoy ya no debería de suceder lo mismo, ya que no encontraron falla alguna. Distribuidora confirma que el servicio está restablecido correctamente.', '2024-11-10 00:49:12', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (207, 372, 112, 425, NULL, NULL, 'Se llamó a la distribuidora Luz del Sur e indica que desde las 7:40 pm fue reportado la orden por concepto de interrupción en la zona. El plazo de atención es de 4 horas y el código de atención es  693755-151.', '2024-11-11 20:11:47', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (208, 372, 112, 426, NULL, NULL, 'Se llamó a la Sra. Ruth Chavarri de la empresa IRON MOUNTAIN PERU S.A y se detalla la información de su distribuidora con el plazo y código de atención. Solicita hacer seguimiento al caso y que sea notificada en cuanto a los avances.', '2024-11-11 20:32:05', '2024-11-11 20:35:56', 372);
INSERT INTO `cvc_seguimientos` VALUES (209, 372, 112, 428, NULL, NULL, 'Llamó nuevamente la Sra. Ruth Chavarri de la empresa IRON MOUNTAIN PERU S.A e indica que la luz ha retornado pero aún no se ha acercado la cuadrilla de Luz del Sur. Desea saber si ya no se irá la luz para dar concluido la atención. Se indicó que existe un plazo de atención pero se llamará a su distribuidora y cuando tengamos alguna respuesta se devolverá la comunicación.', '2024-11-11 21:20:42', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (210, 372, 112, 429, NULL, NULL, 'Se llamó a la distribuidora y derivan al área pero ya no contestan.', '2024-11-11 22:33:13', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (211, 374, 112, 431, NULL, NULL, 'Se llamó a Luz del Sur, para consultar estatus de la emergencia reportada y mencionan que aún se encuentra en proceso de atención ya que hay demoras por \"Trabajos con riesgo de vida\". Se registra nueva incidencia con catalogación Fuera de plazo de atención con código 693755-153. \n\nSe comunicó técnico de Luz del Sur a la 01:11 am y menciona que el incidente reportado, ya fue solucionado y la causa fue provocada por terceros, por lo que solicita dejar el documento de la incidencia levantada. Sin embargo, indica que el documento debe ser entregado a la persona que reportó la incidencia, al no encontrarnos en el lugar, dicho documento lo enviará por correo a la titular a nombre de la asesora Darline Gaitan.', '2024-11-12 00:18:18', '2024-11-12 06:03:33', 374);
INSERT INTO `cvc_seguimientos` VALUES (214, 374, 112, 433, NULL, NULL, 'Se llamó al cliente y se informa lo mencionado por la distribuidora, nuevo plazo de atención es de 4 horas más.', '2024-11-12 00:35:40', '2024-11-12 00:38:59', 378);
INSERT INTO `cvc_seguimientos` VALUES (217, 374, 112, 435, NULL, NULL, 'Se llamó al cliente para informar que el inconveniente ya fue solucionado, asimismo, se le indica las causas. Se menciona que se le volverá a llamar por la mañana para confirmar la recepción del documento.', '2024-11-12 01:34:45', '2024-11-12 01:51:07', 374);
