INSERT INTO `cvc_seguimientos` VALUES (305, 372, 174, 625, NULL, NULL, 'Se comunicó el Sr. EULER de la empresa PLASTIC TECNOLOGIA PERU e indica que en su planta no tiene luz desde las 4: 54 pm debido a que una excavadora cerca a la entrada de Ramiro Priale tocó cables de los fusiles desde el subterráneo. Brinda referencia al frente de Real Plaza Santa Clara. Solicita una cuadrilla de emergencia.', '2024-11-15 18:11:41', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (306, 372, 174, 626, NULL, NULL, 'Se llamó a la distribuidora Luz del Sur y no contesta.', '2024-11-15 18:16:21', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (307, 372, 174, 627, NULL, NULL, 'Se llamó a la distribuidora Luz del Sur a explicar lo sucedido y generó una orden de reporte por  concepto de interrupción en el  predio. Brinda plazo de atención para la inspección de 4 horas y el código de atención es 442346-298.', '2024-11-15 18:36:05', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (308, 372, 174, 628, NULL, NULL, 'Se comunicó la trabajadora (no facilita nombre)  de la empresa PLASTIC TECNOLOGIA PERU e indica que no tiene luz. Se explicó que se generó una orden de reporte por  concepto de interrupción en el  predio. Brinda plazo de atención para la inspección de 4 horas y el código de atención es 442346-298.', '2024-11-15 18:36:37', '2024-11-15 21:54:20', 372);
