INSERT INTO `cvc_seguimientos` VALUES (316, 375, 174, 639, NULL, NULL, 'Nos comunicamos con el  Sr. RUBEN PASTOR, para consultar si recibió el correo  por parte de la distribuidora, menciona que  no le llego correo. Se le solicita nombre de  TÉCNICO ESPECIALISTA EN MT  y numero celular indica que  le devolvamos llamada en  30 minutos para que nos brinde información y así comunicarnos con la distribuiidora', '2024-11-16 08:18:28', '2024-11-16 08:22:45', 375);
INSERT INTO `cvc_seguimientos` VALUES (317, 375, 174, 640, NULL, NULL, 'Se llamó a cliente, 2 VECES  para que nos brinde nombre de TÉCNICO ESPECIALISTA EN MT  pero no se tiene  éxito.', '2024-11-16 09:23:28', '2024-11-16 09:32:45', 375);
INSERT INTO `cvc_seguimientos` VALUES (318, 375, 174, 641, NULL, NULL, 'Se comunicó Srta MARISSA  CALDERON  brinda numero de cliente  30775,  se le menciona que nos estuvimos comunicando con el Sr RUBEN PASTOR, se menciona que la falla es interna. Srta. Marissa,   solicita planos de cableados  para que pueden realizar su trabajo, Menciona que los cables están expuestos en la pista  e indica que puede pasar  un accidente.  Se le indica que nos comunicaremos con el Sr RUBEN PASTOR , para que nos brinde  nombre  del TECNICO ESPECIALISTA DE MT, luego de ello nos comunicaremos con la distribuidora.', '2024-11-16 09:52:24', '2024-11-16 12:10:26', 375);
INSERT INTO `cvc_seguimientos` VALUES (319, 375, 174, 642, NULL, NULL, 'Nos comunicamos Sr RUBEN PASTOR, menciona que ya encontró  la falla donde la retro escabadora levanto los cables,  y solicita que nos comuniquemos en  20 minutos para que nos brinde datos de TÉCNICO ESPECIALISTA  DE  MT .', '2024-11-16 09:56:30', '2024-11-16 12:13:58', 375);
INSERT INTO `cvc_seguimientos` VALUES (321, 375, 174, 644, NULL, NULL, 'Nos comunicamos con LUZ DEL SUR,  para solicitar el informe  por falla interna por parte del cliente porque cliente menciona  que no llego. Nos menciona que debemos enviar un correo para solicitar  CARTA POR DEFECTO INTERNO nos brinda correo electrónico,  fonoluz@luzdelsur.com.pe  e indica  que tiene plazo de  atención  2 horas.  Se procedió con el correo -', '2024-11-16 10:53:32', '2024-11-16 12:21:59', 375);
INSERT INTO `cvc_seguimientos` VALUES (323, 375, 174, 645, NULL, NULL, 'Se comunicó Srta MARISSA CALDERÓN, menciona que es una empres que  esta trabajando  afuera del predio del cliente  PLASTIC TECNOLOGIA, se le indica que debe comunicarse  con luz de sur para reportar el incidente, Asimismo le mencionamos que  ya hemos solicitado el informe técnico al  LUZ DEL SUR,    para derivarlo al cliente, Se indica a Srta Marissa que debe reportar el incidente  a  LUZ DEL SUR  como contratistas de la municipalidad.', '2024-11-16 11:59:14', '2024-11-16 12:48:39', 375);
