INSERT INTO `cvc_seguimientos` VALUES (340, 375, 179, 686, NULL, NULL, 'Nos comunicamos con el Sr. JOAQUIN REYES, para mencionarle lo indicado  por parte de su distribuidora  ya pueden tomar carga, la energía fue restablecida. Se cierra el caso.', '2024-11-18 10:17:22', '2024-11-18 10:26:29', 375);
