INSERT INTO `cvc_seguimientos` VALUES (342, 375, 151, 694, NULL, NULL, 'Se comunicó Sr TONY ZAPATA, consultado sobre el   pago que no se visualiza en el sistema,  indica que envio correo con el comprobante de pago, el correo se envió  a Jose para la verificación', '2024-11-18 16:14:17', '2024-11-18 17:01:26', 375);
INSERT INTO `cvc_seguimientos` VALUES (343, 374, 182, 697, NULL, NULL, 'Se comunicó el Sr. Segundo Navarro, reportando la misma incidencia, se le menciona que nos comunicaremos con la distribuidora. Solicita que se le informe al número del cual se está comunicando.', '2024-11-18 23:56:07', '2024-11-19 00:19:50', 374);
INSERT INTO `cvc_seguimientos` VALUES (344, 374, 182, 698, NULL, NULL, 'Se llamó a la distribuidora e indica que la emergencia ya había sido reportada por el Técnico Electricista de planta, Sr. Miguel Llontop Silva, al rededor de las 11:13pm con el número de atención 25170821502. Asimismo, el plazo de atención es de 4 horas. Por otro lado, distribuidora menciona que hará una reiteración con número de atención \n25170821512.', '2024-11-19 00:09:09', '2024-11-19 00:29:42', 374);
INSERT INTO `cvc_seguimientos` VALUES (345, 374, 182, 699, NULL, NULL, 'Se llamó a cliente y no se logra escuchar, corta llamada.', '2024-11-19 00:10:46', '2024-11-19 00:29:45', 374);
INSERT INTO `cvc_seguimientos` VALUES (346, 374, 182, 700, NULL, NULL, 'Se llamó al Sr. Segundo, para indicar lo mencionado por la distribuidora y se brinda plazo de atención.', '2024-11-19 00:12:26', '2024-11-19 00:30:26', 374);
INSERT INTO `cvc_seguimientos` VALUES (347, 374, 182, 701, NULL, NULL, 'Se comunica trabajador de la empresa, consultando que fue lo que indicó la distribuidora, se le informa lo mencionado al sr. Segundo y comenta que ya tenía conocimiento de ello.', '2024-11-19 00:27:05', '2024-11-19 07:23:22', 378);
INSERT INTO `cvc_seguimientos` VALUES (348, 378, 182, 702, NULL, NULL, 'Se llamó al Sr. SEGUNDO NAVARRO pero se corta la comunicación.', '2024-11-19 07:10:16', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (349, 378, 182, 705, NULL, NULL, 'Se llamó a la distribuidora para consultar si la emergencia reportada fue atendida e indica que aún esta pendiente de atención, pero priorizarán dicha atención y coordinará con el área técnica encargada para que pueda acercarse en menor tiempo. Menciona que no tiene un plazo pero se estima que se  solucione en transcurso de la mañana. Número de atención por reiteración 25170821613.', '2024-11-19 07:39:36', '2024-11-19 07:49:55', 378);
INSERT INTO `cvc_seguimientos` VALUES (350, 378, 182, 706, NULL, NULL, 'Se llamó al Sr. SEGUNDO NAVARRO de la empresa RED DE DISTRIBUCIÓN GALVEZ para informar lo indicado por su distribuidora, el cual aún esta pendiente de atención, pero priorizarán y se coordinará con el área técnica encargada para que puedan acercarse en menor tiempo y se espera que se solucione en transcurso de la mañana pero comenta que cuenta con energía desde 5:20 am.', '2024-11-19 07:55:52', '2024-11-19 07:57:25', 378);
INSERT INTO `cvc_seguimientos` VALUES (351, 378, 182, 707, NULL, NULL, 'Se volvió a comunicar el Sr. SEGUNDO NAVARRO recalcando que sigue sin energía, se le indicó que la distribuidora está revisando el caso.', '2024-11-19 08:09:39', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (352, 378, 184, 714, NULL, NULL, 'Se llamó a la distribuidora para informa lo indicado por la empresa CENTRAL PARIACHI S.A.C. que no cuenta con energía en toda la zona desde hace 20 minutos, 10:30 am aproximadamente. La distribuidora menciona que no es un corte programado, indica que se ha generado una interrupción zonal pero aun no se conoce el motivo ya que el personal técnico se encuentra en camino para determinar el  factor que genero interrupción. Asimismo, informa que la encargada de la empresa CENTRAL PARIACHI S.A.C. Gladis Quinto se comunicó reportando dicha interrupción. Comenta que se encuentra dentro del plazo de atención 4 horas. Código de orden 352762-291.', '2024-11-19 11:15:27', '2024-11-19 12:13:12', 379);
INSERT INTO `cvc_seguimientos` VALUES (353, 378, 184, 716, NULL, NULL, 'Se comunicó Srta Gladis Quinto de la empresa CENTRAL PARIACHI S.A.C. y se indico lo que la distribuidora nos informo cuando se llamo,  no cuenta con corte programado, aun no saben el factor de la interrupción zonal, pero ya se encuentra en camino la  cuadrilla para la verificación, se le volvió a mencionar el plazo de atención de 4 horas.', '2024-11-19 11:28:00', '2024-11-19 12:14:17', 378);
INSERT INTO `cvc_seguimientos` VALUES (354, 378, 182, 717, NULL, NULL, 'Se llamó a la distribuidora para consultar sobre el status de la emergencia reportada e indica que aún esta pendiente dicha atención. Menciona que comunicará a su coordinador a fin de que se solucione con suma urgencia. Número de sub estación N618.  Número de atención por reiteración. 25170822091', '2024-11-19 11:59:20', '2024-11-19 12:21:16', 378);
INSERT INTO `cvc_seguimientos` VALUES (355, 378, 182, 718, NULL, NULL, 'Se llamó al Sr. SEGUNDO NAVARRO RED DE DISTRIBUCION GALVEZ para informar lo mencionado de su distribuidora que la emergencia reportada aún está pendiente de atención, se comunicará con su coordinador a fin de que se solucione a la brevedad. Se comenta que hará el seguimiento a su distribuidora.', '2024-11-19 12:07:40', '2024-11-19 12:27:25', 378);
INSERT INTO `cvc_seguimientos` VALUES (356, 372, 184, 720, NULL, NULL, 'Se comunicó Srta. Gladis Quinto de la empresa CENTRAL PARIACHI S.A.C. y se explicó el plazo de atención de 4 horas donde se está haciendo seguimiento al caso.', '2024-11-19 13:00:03', NULL, NULL);
