INSERT INTO `cvc_seguimientos` VALUES (358, 378, 184, 723, NULL, NULL, 'Se llamó a la distribuidora para consultar respecto a la emergencia reportada, nos dejo en espera y corto la llamada.', '2024-11-19 15:20:52', NULL, NULL);
