INSERT INTO `cvc_seguimientos` VALUES (364, 372, 182, 730, NULL, NULL, 'Se llamó al Sr. SEGUNDO NAVARRO de la empresa RED DE DISTRIBUCION GALVEZ y se explicó que hubo un mantenimiento programado y en unos minutos regresará la luz.', '2024-11-19 17:30:43', NULL, NULL);
