INSERT INTO `cvc_seguimientos` VALUES (374, 374, 184, 743, NULL, NULL, 'Se comunicó el Sr. Alejandro, indicando que la energía fue restablecida. Sin embargo, tienen oscilación de tensión y la energía va y viene de rato en rato.', '2024-11-19 22:28:10', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (375, 374, 184, 744, NULL, NULL, 'Se llamó a la distribuidora, para indicar el inconveniente reportado por  CENTRAL PARIACHI S.A.C.  y distribuidora indica que la cuadrilla se acercó al lugar y realizó la verificación al PMI 7679, donde el informe realizado por los técnicos, menciona que el fluido eléctrico se encuentra regularizado con normalidad. Asimismo, no se encontraron fallas.', '2024-11-19 22:51:43', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (376, 374, 184, 745, NULL, NULL, 'Se llamó al cliente para indicar lo mencionado por la distribuidora y solicita que nos volvamos a comunicar en 10 minutos nuevamente para que pueda corroborar la información.', '2024-11-19 22:55:30', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (377, 374, 184, 746, NULL, NULL, 'Se llamó nuevamente al cliente y confirma que  ya no ha tenido problemas con el fluido eléctrico.', '2024-11-19 23:13:15', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (378, 374, 182, 747, NULL, NULL, 'Se llamó al centro de control e indica que el servicio de luz, se regularizó el día de ayer a las 6:00 pm.', '2024-11-20 06:03:06', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (379, 374, 182, 748, NULL, NULL, 'Se llamó al Sr. Segundo Navarro, quien confirma que su fluido eléctrico ya se regularizó desde las 6:50 pm del día de ayer 19/11/2024.', '2024-11-20 06:06:25', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (380, 375, 188, 751, NULL, NULL, 'Se llamó a distribuidora ENSA, para  reportar  incidente,  menciona que no hay corte programado y nos brinda código de atención 25170823503   con un plazo de atención  4 horas', '2024-11-20 09:51:44', '2024-11-23 20:40:00', 372);
INSERT INTO `cvc_seguimientos` VALUES (381, 375, 188, 752, NULL, NULL, 'Se llamó al Sr. SEGUNDO NAVARRO, para informar lo mencionado por su distribuidora ENSA, le brindados plazo de atencion de  4 horas,  a la vez menciona que ya  regreso el fluido eléctrico pero quiere saber si se volverá a ir, se le  indica que igual le realizaremos el seguimiento  correspondiente.', '2024-11-20 09:57:38', '2024-11-20 09:59:56', 375);
INSERT INTO `cvc_seguimientos` VALUES (382, 375, 188, 754, NULL, NULL, 'Se llamó al Sr. SEGUNDO NAVARRO, para confirmar el retorno de la energía, menciona que regreso a las  9:45 am menciona que esta con normalidad el fluido eléctrico.', '2024-11-20 10:44:27', '2024-11-23 20:42:15', 372);
INSERT INTO `cvc_seguimientos` VALUES (383, 372, 182, 755, NULL, NULL, 'Se llamó al centro de control y no contesta.', '2024-11-19 20:56:10', '2024-11-20 11:47:23', 370);
INSERT INTO `cvc_seguimientos` VALUES (384, 375, 151, 771, NULL, NULL, 'Se llamó al cliente TONY ZAPATA, para informar  lo siguiente \" También decirle que, si hace un pago igual por el mismo medio, ósea transferencia, debe enviar la constancia de pago al correo de cobranzas@cvcenergia.com.pe y en asunto poner el número de suministro.\"', '2024-11-21 09:37:31', '2024-11-21 10:35:38', 375);
INSERT INTO `cvc_seguimientos` VALUES (385, 375, 191, 778, NULL, NULL, 'Se llamó a cliente, NO se tiene éxito.', '2024-11-21 12:17:44', '2024-11-21 14:11:40', 375);
INSERT INTO `cvc_seguimientos` VALUES (386, 375, 191, 780, NULL, NULL, 'Se llamó Sra.  MILUSKA RAMIREZ,  se informo lo siguiente.  Todo trámite de instalación, reubicación, retiro, etc. de un suministro debe ser realizado en las oficinas presenciales. Deberá tener a la mano los siguientes documentos:  Copia simple del DNI del titular, Copia del título de propiedad, certificado literal o constancia de posesión debidamente legalizada (último 3 meses,  Croquis de ubicación,  Carta solicitud de reubicación de suministro Copia del último recibo cancelado.  Debe dejar los documentos en oficina, después de 5 a 7 días aprox., se le entregará el presupuesto donde visualizará el costo (no hay un aproximado) y los requisitos técnicos, el cliente puede decidir pagarlo en oficina o por un agente, si es por agente tiene que dirigirse a oficina a dejar el voucher, con esto, se programa la fecha de la reubicación. (la fecha de reubicación es de aprox 7 días calendarios.', '2024-11-21 13:38:02', '2024-11-21 16:07:16', 375);
INSERT INTO `cvc_seguimientos` VALUES (387, 375, 198, 795, NULL, NULL, '.Se comunicó Srta, YANELA TITO, para informar que desde hace  1 hora no cuenta con luz en toda la zona, se menciona que nos comunicaremos con LUZ DE SUR para realizar las consultas correspondientes.', '2024-11-22 08:47:38', '2024-11-22 09:32:56', 375);
INSERT INTO `cvc_seguimientos` VALUES (388, 378, 198, 797, NULL, NULL, 'Se comunicó ejecutiva Lorena Guerrero de CVC indicando que se debe reportar la emergencia debido a que la empresa CENTRAL PARIACHI S.A.C. no tiene luz hace 1 hora.', '2024-11-22 08:57:58', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (389, 375, 198, 798, NULL, NULL, 'Se comunico Sra. GLADYS QUINCHO  para informar que no cuenta con luz desde hace  1 hora se le brinda información brindada por LUZ DEL SUR, es una interrupción zonal, brindan plazo   4 horas para que se acerque una cuadrilla,   con código de atención    352762-302.', '2024-11-22 09:02:44', '2024-11-23 19:51:20', 372);
INSERT INTO `cvc_seguimientos` VALUES (390, 375, 198, 799, NULL, NULL, 'Se llamo Sr. ALEJANDRO   para informar lo mencionado por  LUZ DEL SUR, no hay corte programado, es una interrupción zonal brinda plazo de atención de  4 horas con código 352762-302 .', '2024-11-22 09:08:14', '2024-11-22 09:38:00', 375);
INSERT INTO `cvc_seguimientos` VALUES (400, 375, 198, 796, NULL, NULL, 'Nos comunicamos con LUZ DEL SUR,  para  informar que cliente no cuenta con energía eléctrica desde   7:40 am  menciona que no hay corte programado e indica que es una interrupción zonal brinda plazo de atención de 4 horas y nos da un código  352762-302.', '2024-11-22 08:57:58', '2024-11-22 09:54:49', 375);
INSERT INTO `cvc_seguimientos` VALUES (401, 375, 200, 802, NULL, NULL, 'Se llamo Srta. CAROLINA SARAVIA,  para informar lo siguiente: que mediante el aplicativo BCP su deuda aparece con total normalidad, tiene que revisar su plataforma, no hay problemas con el banco ni de parte de nosotros.\nRecuerden que tienen que buscarnos en el app como “Coelvisac” en el apartado de “pagar servicios”', '2024-11-22 11:11:12', '2024-11-22 11:12:52', 375);
INSERT INTO `cvc_seguimientos` VALUES (402, 375, 198, 803, NULL, NULL, 'Se llamó SL Sr. ALEJANDRO MANDUJANO, no se tiene éxito.', '2024-11-22 11:33:33', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (403, 375, 198, 805, NULL, NULL, 'Nos comunicamos con LUZ DEL SUR, para consultar como va el caso, menciona que van a reiterar  la orden técnica, aun no cuentan con el informe por parte de su área técnica e indica que aun están dentro del plazo,  una cuadrilla esta en el punto realizando la invetigacion,', '2024-11-22 12:25:37', '2024-11-22 12:31:47', 375);
INSERT INTO `cvc_seguimientos` VALUES (405, 375, 198, 807, NULL, NULL, 'Se llamo Sr. ALEJANDRO MANDUJANO,  para consultar si cuenta ya con energía eléctrica y confirma que llego a las  11:10 am.', '2024-11-22 13:39:31', '2024-11-23 19:52:10', 372);
INSERT INTO `cvc_seguimientos` VALUES (406, 375, 203, 821, NULL, NULL, 'Nos comunicamos con PLUZ ENERGÍA, no se tuvo éxito.', '2024-11-23 15:47:30', '2024-11-23 16:05:33', 375);
INSERT INTO `cvc_seguimientos` VALUES (407, 375, 203, 822, NULL, NULL, 'Nos comunicamos con PLUZ ENERGÍA, para reportar el incidente  por parte de cliente,  indica que  va generar la emergencia,  para que los técnicos hagan la verificación correspondiente, brinda plazo de atención  hasta las  11:57 pm  con código 698210986.', '2024-11-23 15:59:54', '2024-11-23 16:05:31', 375);
INSERT INTO `cvc_seguimientos` VALUES (408, 375, 203, 823, NULL, NULL, 'Se llamo  Sr. Vladimir, para informarle lo mencionado por PLUZ ENERGIA, se brinda plazo de atención de  4 horas se ingreso su emergencia con su distribuidora.', '2024-11-23 20:33:35', '2024-11-23 16:20:01', 375);
INSERT INTO `cvc_seguimientos` VALUES (409, 372, 203, 825, NULL, NULL, 'Se llamó a la distribuidora PLUZ ENERGÍA e indica que un técnico se ha acercado a evaluar pero aún falta que llegue la cuadrilla, recalca que están dentro del plazo de atención hasta las 11:57 pm.', '2024-11-23 20:33:43', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (410, 372, 203, 826, NULL, NULL, 'Se llamó al Sr. Vladimir y  se explicó que la distribuidora PLUZ ENERGÍA indicó que un técnico se ha acercado a evaluar pero aún falta que llegue la cuadrilla y  están dentro del plazo de atención. Se estará realizando el seguimiento correspondiente.', '2024-11-23 20:33:41', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (411, 381, 203, 830, NULL, NULL, 'Se llamo a distribuidor, se insiste y no contesta. Se seguirá insistiendo', '2024-11-24 00:48:45', '2024-11-24 00:54:33', 381);
INSERT INTO `cvc_seguimientos` VALUES (412, 376, 203, 842, NULL, NULL, 'Se contacto el Sr Vladimir Garay el cual refiere que ya cuenta con fluido eléctrico  y así mismo indica que estará enviando un  correo a CVC  solicitando  información mas detallada  acerca del incidente.\nHora aproximada que se fue el fluido eléctrico 15:00 p.m. 23/11/24 \nHora aproximada que pudo verificar el cliente el que retorno el fluido eléctrico 8: 15 a.m. 24/11/24\ncelular de referencia : 992799795', '2024-11-24 08:55:51', '2024-11-24 11:12:55', 376);
INSERT INTO `cvc_seguimientos` VALUES (413, 376, 208, 841, NULL, NULL, 'Se llamo a distribuidora la cual indica que no hay ningun corte programado y que motivo del corte es porque ha habido un accidente con un poste.\nLa distribuidora indica que dentro de las proximas 4   horas se estara acercado el  personal tecnico.\n\nCod de reporte: 400678-113', '2024-11-24 08:55:51', '2024-11-24 09:42:19', 376);
INSERT INTO `cvc_seguimientos` VALUES (414, 376, 208, 843, NULL, NULL, 'Se llamo al cliente Gisel Silva se le indica que el personal técnico estará atendiendo la emergencia dentro del plazo de 4 horas.', '2024-11-24 09:50:22', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (415, 376, 204, 845, NULL, NULL, 'Se comunicó el Sr. Frack Casahuaman Castillo indicando que no cuenta con fluido eléctrico.\nSe le informa que tiene programado un rechazo de carga el día de hoy  desde las 6:00 hasta las 16:00.\nCelular de referencia: 904249082', '2024-11-24 11:49:46', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (416, 376, 208, 847, NULL, NULL, 'Se llamo a la Sra. Gisel Silva cel. 920209374 sin exito.', '2024-11-24 12:47:41', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (417, 373, 208, 852, NULL, NULL, 'Se llamó a la Sra. Gisel Silva 920209374 pero aún no contesta.', '2024-11-24 14:00:04', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (418, 373, 210, 854, NULL, NULL, 'Se llamó a la distribuidora Electro Ucayali (61597272), nos comentan que no hay corte programado por lo que en un plazo de 4 horas se acercarán para solucionar el inconveniente, se llamará al Sr. Franck Casahuamanca.', '2024-11-24 14:19:28', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (422, 373, 210, 855, NULL, NULL, 'Se llamó al Sr. Franck Casahuamanca, para informarle el plazo de 4 horas indicado por la distribuidora, sin embargo el Sr. Franck mencionó que hace 15 minutos la energía volvió con normalidad. Se cierra el caso.', '2024-11-24 14:31:01', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (423, 373, 208, 856, NULL, NULL, 'Se llamó a la Sra. Gisel Silva, quien comentó que el fluido eléctrico regresó en un aproximada de las 11 am con minutos ya que no estuvo en el colegio para brindar una hora exacta. Se cierra el caso.', '2024-11-24 15:10:32', '2024-11-24 15:14:30', 373);
INSERT INTO `cvc_seguimientos` VALUES (424, 373, 204, 857, NULL, NULL, 'Se llamó al Sr. Jean Piere pero fue sin éxito.', '2024-11-24 16:19:50', NULL, NULL);
