INSERT INTO `cvc_seguimientos` VALUES (444, 372, 225, 903, NULL, NULL, 'Se llamó al Sr. FREDY MENDOZA de la empresa LINEA PET PERU e indica que regresó la luz a las 6:40 pm pero desde las 7:50 pm hasta ahora está presentando caída de tensión y oscilación de voltaje.', '2024-11-25 19:58:33', '2024-11-25 20:07:10', 372);
INSERT INTO `cvc_seguimientos` VALUES (445, 372, 225, 904, NULL, NULL, 'Se llamó al centro de control y se indicó que la empresa  LINEA PET PERU desde las 7:50 pm hasta ahora está presentando caída de tensión y oscilación de voltaje. Centro de control menciona que se debe mandar correo ya que ese servicio tiene un costo si llegara ser responsabilidad del cliente (no se ha fijado bien las instalaciones) se debe inspeccionar donde se va a desplazar una camioneta y personal.', '2024-11-25 20:15:29', '2024-11-25 20:59:06', 372);
INSERT INTO `cvc_seguimientos` VALUES (446, 372, 225, 905, NULL, NULL, 'Se llamó al Sr. FREDY MENDOZA y se explicó debido a que es un  problema interno se debe hacer mantenimiento correctivo y preventivo para lograr despejar esa variación de tensión, ya que Hidrandina nos ha confirmado que no hay fallas en el alimentador de Hidrandina que alimenta a LINEA PET PERU,  para  gestionar dicho servicio (el pago correspondiente) se sugiere enviar un correo con dicha solicitud el día de mañana a  la Srta. Betzabe Clavarino al correo bclavarino@cvcenergia.com.pe . Responde que primero lo verificará con su área de persistir el error mandará el correo.', '2024-11-25 20:49:21', '2024-11-25 21:00:46', 372);
