INSERT INTO `cvc_seguimientos` VALUES (464, 378, 324, 965, NULL, NULL, 'Se llamó al Sr. LUIS SANDOVAL VALDIVIESO de la empresa  PROCESADORA COMERCIALIZADORA MONTENEGRO | PROCOM SAC, se informó lo indicado por su distribuidora Pluz Energía, que dicha emergencia ha sido derivado al personal técnico quien estaría cubriendo el incidente y solucionaran el día de hoy en transcurso de horas, en caso la emergencia sea compleja se derivará a otro cuadrilla.', '2024-11-27 13:37:49', '2024-11-27 14:40:28', 378);
