INSERT INTO `cvc_seguimientos` VALUES (474, 372, 324, 980, NULL, NULL, 'Se llamó a la distribuidora PLUZ ENERGIA e informa que aún no hay resultado. Esta generando la reiteración de la incidencia y elevando al área interna con un plazo de atención hasta las 5:00 am ya que es un proceso de emergencia.', '2024-11-27 21:40:29', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (475, 372, 324, 981, NULL, NULL, 'Se llamó al Sr.  LUIS SANDOVAL VALDIVIESO  y explicó que la distribuidora PLUZ ENERGIA informa que aún no hay resultado. Esta generando la reiteración de la incidencia y elevando al área interna con un plazo de atención de 4 horas ya que es un proceso de emergencia. El Sr. LUIS SANDOVAL VALDIVIESO indica  que ahora el cable esta por el piso (un tramo se ha roto) pero ya no es un caso urgente al parecer es un cable de telecomunicaciones. Finalmente se notifica que se está haciendo el seguimiento al caso.', '2024-11-27 21:40:25', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (476, 381, 324, 986, NULL, NULL, 'Se llamó a la distribuidora, para que nos informen sobre el resultado del reporte generado por nuestro cliente, indicaron que aún no se cuenta con respuesta y que el plazo vence 05:15 am. Acotamos que nos puedan apoyar con la solución y mencionaron que van a coordinar de manera interno con el cuerpo técnico para poder solucionar la incidencia.', '2024-11-28 02:09:51', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (477, 381, 324, 987, NULL, NULL, 'Nos comunicamos nuevamente con la distribuidora, mencionan que el plazo vence 05:15 am se le pregunto si en 30 minutos que faltan para el vencimiento del plazo, se va a dar por solucionado o al menos se acercaran a realizar la revisión correspondiente, nos indica que es poco probable, y que en las primeras horas de la mañana (8 a 9 aprox) se deben estar acercando. Incidimos en que requerimos puedan ir lo más pronto posible.', '2024-11-28 04:50:04', NULL, NULL);
INSERT INTO `cvc_seguimientos` VALUES (478, 381, 324, 988, NULL, NULL, 'Se llamó al cliente, no llego a contestar.', '2024-11-28 05:35:59', NULL, NULL);
