INSERT INTO `cvc_seguimientos` VALUES (480, 375, 324, 990, NULL, NULL, 'Nos comuniquemos  con  la DISTRIBUIDORA PLUZ ENERGIA, menciona que va reiterar al área correspondiente nuestro caso, nos brinda plazo de atención  de 8 hora máximo 3-00 pm, no cuenta con ningún informe hasta el momento.', '2024-11-28 07:24:25', '2024-11-28 07:36:21', 375);
INSERT INTO `cvc_seguimientos` VALUES (481, 375, 324, 991, NULL, NULL, 'Nos comunicamos con el Sr.  LUIS SANDOVAL, para informarle que PLUZ ENERGIA,  amplio su tiempo de  atención,  hasta las  11 am, le mencionamos que  de igual manera le estamos realizando el seguimiento correspondiente, se menciona que le hemos realizo llamadas sin éxito  e indica que  no  puedo contestar en ese horario.', '2024-11-28 07:30:42', '2024-11-28 07:38:00', 375);
INSERT INTO `cvc_seguimientos` VALUES (482, 375, 324, 993, NULL, NULL, 'Nos comunicamos con Sr. LUIS SANDOVAL, para informarle  que los cables mencionados no son de propiedad de Pluz Energía, se tratan de cables de telecomunicaciones. Por lo tanto, corresponde que se puedan comunicar con la empresa correspondiente para solicitar las gestiones correctivas respecto al cable suelto. Se cierra el caso.', '2024-11-28 08:51:46', NULL, NULL);
