INSERT INTO `cvc_solicitudes` VALUES (311, 466, 928, 5, 'Se comunicó   familiar del titular  Sr.  CRISTIAN LEVANO, menciona que realizó el pago ayer y solicita recconexión. Se explica que  se volverá a enviar el correo  para la atención en el tiempo establecido. Se reenvía correo a José.', '2024-11-26 15:00:55', '2024-11-26 18:58:33', NULL, 375, 372, NULL, 0);
INSERT INTO `cvc_solicitudes` VALUES (312, 462, 930, 5, 'Se comunicó familiar de titular Srta. VALENTINA MOROGUILCA, menciona que realizó el pago ayer  y solicita la reconexión. Se explica que  hay varios suministros en la misma situación de corte  que se está reconectando progresivamente. Se derivará su correo al área correspondiente.', '2024-11-26 15:55:32', '2024-11-26 19:31:26', NULL, 375, 372, NULL, 0);
INSERT INTO `cvc_solicitudes` VALUES (313, 469, 931, 5, 'Se comunicó  familiar del titular  Srta. GRACIELA  MIRANDA,  menciona que realizó el pago ayer pero se corta la llamada.', '2024-11-26 16:31:49', '2024-11-26 19:33:19', NULL, 375, 372, NULL, 0);
INSERT INTO `cvc_solicitudes` VALUES (314, 469, 932, 5, 'Se comunicó  familiar del titular  Srta. GRACIELA  MIRANDA,  menciona que realizó el pago  ayer a las  10:50 am  solicita reconexión. Se explica que  hay varios suministros en la misma situación de corte  que se está reconectando progresivamente. Se derivará su correo al área correspondiente.', '2024-11-26 16:33:04', '2024-11-26 19:34:19', NULL, 375, 372, NULL, 0);
INSERT INTO `cvc_solicitudes` VALUES (315, 463, 933, 5, 'Se comunicó nuevamente  encargada  del precio  Srta. SILVIA HUAMAN, solicita reconexión. Se informa que hay varios suministros en la misma situación de corte  que se esta reconectando progresivamente se derivara su correo al área correspondiente pero desea que se haga lo más antes posible porque indica que trabaja con niños. También desea que le llegue los recibos de manera física.', '2024-11-26 17:46:59', '2024-11-29 15:26:13', NULL, 372, 375, NULL, 0);
INSERT INTO `cvc_solicitudes` VALUES (316, 188, 943, 4, 'Se llamo a Srta.  MARÍA, para consultar sobre corte programado  con fecha 21/11 desde 8:00 - 18:30,  no se tuvo éxito.', '2024-11-27 08:06:32', '2024-11-27 10:33:26', NULL, 375, 375, NULL, 0);
INSERT INTO `cvc_solicitudes` VALUES (317, 217, 944, 4, 'Se llamó a Sr. HAROLD SALAZAR, para consultar sobre corte programado  con fecha 24/11 desde 7:00 - 15:30,  no se tuvo éxito.', '2024-11-27 08:12:28', '2024-11-27 11:08:57', NULL, 375, 375, NULL, 0);
INSERT INTO `cvc_solicitudes` VALUES (318, 225, 945, 4, 'Se llamó a Sr. JEAN PIERRE, para consultar sobre corte programado  con fecha 21/11 desde 8:30 am  a 18:30pm, menciona que se realizó correctamente.', '2024-11-27 08:19:43', '2024-11-28 17:34:46', NULL, 375, 372, NULL, 0);
INSERT INTO `cvc_solicitudes` VALUES (319, 253, 946, 4, 'Se llamó a Sr. CARLOS HERRERA de la empresa MANUELITA FYH S.A.C. para consultar sobre el corte programado  con fecha 24/11 desde 6:00 am - 14:00pm , confirma que se procedió correctamente,  la energía llegó cerca de la  13:55 pm.', '2024-11-27 08:25:35', '2024-11-27 20:08:11', NULL, 375, 372, NULL, 0);
INSERT INTO `cvc_solicitudes` VALUES (320, 455, 949, 5, 'Se comunicó familiar del titular  Sr. ROLANDO ACOSTA, para consultar sobre el pago del último recibo. Se confirma que realizó el pago el  15/11 no se registra.', '2024-11-27 08:46:05', '2024-11-29 15:25:17', NULL, 375, 375, NULL, 0);
INSERT INTO `cvc_solicitudes` VALUES (321, 477, 954, 4, 'Se comunicó familiar del titular Sr. JOSE RELAIZA, menciona que no cuenta con fluido eléctrico desde ayer 9:30pm  en su predio. Se cumple con protocolo  para atención  de  emergencia y se envía correo a los  supervisores de LAMBAYEQUE.', '2024-11-27 09:38:51', '2024-11-27 19:04:20', NULL, 375, 372, NULL, 0);
INSERT INTO `cvc_solicitudes` VALUES (323, 188, 960, 2, NULL, '2024-11-27 11:02:33', NULL, '2024-11-27 11:04:07', 375, NULL, 375, 1);
INSERT INTO `cvc_solicitudes` VALUES (324, 329, 961, 4, 'Se comunicó el Sr. LUIS SANDOVAL VALDIVIESO de la empresa PROCESADORA COMERCIALIZADORA MONTENEGRO | PROCOM SAC e indica que a fueras del predio de la planta industrial está unos cables de fluido eléctrico que está colgado entre postes, el cual dificulta la entrada y salida de los camiones debido a que es un riesgo eléctrico. Se informa al cliente que se llamará a su distribuidor para reportar dicha emergencia y luego se devolverá la comunicación para comentar sobre el caso. También  solicita las fotos panorámicas al correo de CVC para informar al área.', '2024-11-27 12:55:30', '2024-11-28 08:52:31', NULL, 378, 375, NULL, 0);
INSERT INTO `cvc_solicitudes` VALUES (325, 478, 971, 4, 'Se llamó a la distribuidora Electrocentro y se explica que la empresa SOCIEDAD MINERA DE RESPONSABILIDAD LIMITADA CAMILA 2008 con suministro 84433074 no cuenta con energía desde la 1pm. Menciona que no hay cortes programados donde el personal se estará acercando en un plazo de 12 horas y brinda código de atención  78671174082.', '2024-11-27 17:20:51', '2024-11-27 19:41:18', NULL, 372, 372, NULL, 0);
INSERT INTO `cvc_solicitudes` VALUES (326, 479, 975, 5, 'Se comunicó el Sr. GUSTAVO PALCO de la empresa telefónica consultando si hay corte programado por POSOSANTO. Se indicó que no ha sido reportado en dicha zona algún corte programado.', '2024-11-27 18:18:53', '2024-11-27 19:38:05', NULL, 372, 372, NULL, 0);
INSERT INTO `cvc_solicitudes` VALUES (327, 112, 995, 5, 'Se llamó a la Srta. Juana Chilquillo para consultar sobre el corte programado del 26/11 que inició  a las  2:00 am y culminó a las  14:00 pm. Menciona que se efectuó correctamente.', '2024-11-28 12:17:43', '2024-11-28 17:37:27', NULL, 375, 372, NULL, 0);
INSERT INTO `cvc_solicitudes` VALUES (328, 480, 1008, 5, 'Se comunicó la Sra. MONICA GUTIERREZ (hija de titular MARIA ORE RAMIREZ DE GUTIERREZ) e indica que no puede hacer el pago desde su aplicativo BCP. Se explicó que en la opción PAGO DE SERVICIOS debe digitar la palabra COELVISAC. Intentará nuevamente y agradece por la llamada.', '2024-11-29 18:17:16', '2024-11-29 18:20:13', NULL, 372, 372, NULL, 0);
