-- ----------------------------
-- Procedure structure for prov_consultas_seguimientos
-- ----------------------------
DROP PROCEDURE IF EXISTS `prov_consultas_seguimientos`;
delimiter ;;
CREATE PROCEDURE `prov_consultas_seguimientos`()
BEGIN
		select
			CONCAT('SOLICITUD') as tipo,
			b.uniqueid,b.lead_id,
			b.f_add,
			b.fecha_marcador,
			b.celular,
			b.codigo_iscom,
			
			a.id as id_solicitud,
			d.descripcion as estado_solicitud,
			
			CONCAT('') as id_seguimiento,			
		
			b.nombres_cliente,
			b.parentesco,
			c.descripcion as tipo_cliente,
			a.resumen_breve,
			a.del as estado_eliminado
		from cvc_solicitudes a 
		left join cvc_call b on a.id_call=b.id
		left join cvc_call_tipo_cliente c on b.id_tipo_cliente=c.id
		left join cvc_estado_solicitud d on a.id_estado_solicitud=d.id

	UNION ALL

		select
			CONCAT('SEGUIMIENTO') as tipo,
			b.uniqueid,b.lead_id,
			b.f_add,
			b.fecha_marcador,
			b.celular,
			b.codigo_iscom,
			
			-- d.descripcion as 'Estado Solicitud',
			a.id_solicitud as  id_solicitud,						
			CONCAT('') as estado_solicitud,
			
			a.id  as id_seguimiento,
		
			
			b.nombres_cliente,
			b.parentesco,
			c.descripcion as tipo_cliente,
			a.descripcion,
			CONCAT('') as estado_eliminado
			-- a.del as estado_eliminado
		from cvc_seguimientos a 
		left join cvc_call b on a.id_call=b.id
		left join cvc_call_tipo_cliente c on b.id_tipo_cliente=c.id; 
		-- left join cvc_estado_solicitud d on a.id_estado_solicitud=d.id 
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for prov_consulta_casos
-- ----------------------------
DROP PROCEDURE IF EXISTS `prov_consulta_casos`;
delimiter ;;
CREATE PROCEDURE `prov_consulta_casos`(in vBase varchar(30),in vCampania varchar(50),in vDep varchar(2), in vTipo VARCHAR(10))
BEGIN

	IF vTipo="VISITADOS" THEN
		IF vDep="" THEN
			select 
				c.id,
				c.nombres,
				c.distrito,
				d.departamento,
				c.campania,
				c.identificador,
				c.direccion,
				c.referencia
			from tb_visitas a
				inner join tb_clientesxusuario b on a.id_clientexusuario=b.id
				inner join tb_clientes c on b.id_cliente=c.id
				inner join tb_departamentos d on c.id_departamento=d.id
				where 
					a.base=vBase COLLATE utf8_general_ci and 
					a.campania=vCampania COLLATE utf8_general_ci 
					group by c.id;
		ELSE 
			select 
				c.id,
				c.nombres,
				c.distrito,
				d.departamento,
				c.campania,
				c.identificador,
				c.direccion,
				c.referencia
			from tb_visitas a
				inner join tb_clientesxusuario b on a.id_clientexusuario=b.id
				inner join tb_clientes c on b.id_cliente=c.id
				inner join tb_departamentos d on c.id_departamento=d.id
				where 
					a.base=vBase COLLATE utf8_general_ci and 
					a.campania=vCampania COLLATE utf8_general_ci and
					c.id_departamento=vDep
					group by c.id;
		END IF; 				
	ELSE
		IF vDep="" THEN 
			select 
				a.id_cliente as id,
				b.nombres,
				b.distrito,
				c.departamento,
				b.campania,
				b.identificador,
				b.direccion,
				b.referencia
			from tb_bases_unificadas a
			left join tb_clientes b on a.id_cliente=b.id
			left join tb_departamentos c on b.id_departamento=c.id 
			where 
			a.id_cliente not in (
				select DISTINCT(a.id_cliente)
				from tb_eqxcampania a 
				inner join tb_campania b on a.id_campania=b.id 
				where b.descripcion=vCampania COLLATE utf8_general_ci 
			) and a.base=vCampania and a.tipobase=vBase COLLATE utf8_general_ci
			group by a.id_cliente;
		ELSE
			select 
				a.id_cliente as id,
				b.nombres,
				b.distrito,
				c.departamento,
				b.campania,
				b.identificador,
				b.direccion,
				b.referencia
			from tb_bases_unificadas a
			left join tb_clientes b on a.id_cliente=b.id 
			left join tb_departamentos c on b.id_departamento=c.id 
			where 
			a.id_cliente not in (
				select DISTINCT(a.id_cliente)
				from tb_eqxcampania a 
				inner join tb_campania b on a.id_campania=b.id 
				where b.descripcion=vCampania COLLATE utf8_general_ci 
			) and a.base=vCampania and a.tipobase=vBase and b.id_departamento=vDep COLLATE utf8_general_ci
			group by a.id_cliente;
		END IF; 
		
	END IF; 
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for prov_consulta_identificador_asig
-- ----------------------------
DROP PROCEDURE IF EXISTS `prov_consulta_identificador_asig`;
delimiter ;;
CREATE PROCEDURE `prov_consulta_identificador_asig`()
BEGIN
	select a.identificador as descripcion,count(a.identificador) as total 
	from tb_clientesxusuario a 
	where a.identificador is not null and  MONTH(a.fecha_asignado)=MONTH(NOW())
	group by a.identificador; 
END
;;
delimiter ;

